import React, { useEffect, useState } from "react";
import Dexie from "dexie";

// âœ… Initialize IndexedDB with Dexie
const db = new Dexie("TalentFlowDB");
db.version(1).stores({
  assessments: "++id,title,sections",
});

// âœ… Function to seed data only once
const seedData = async () => {
  const count = await db.assessments.count();
  if (count === 0) {
    const sampleAssessments = [
      {
        title: "Frontend Developer Assessment",
        sections: [
          {
            name: "Technical Skills",
            questions: [
              { type: "short", text: "What is React?" },
              { type: "long", text: "Explain the Virtual DOM in detail." },
              { type: "single", text: "Which hook manages state?", options: ["useState", "useEffect", "useMemo"] },
              { type: "multi", text: "Select frontend frameworks:", options: ["React", "Django", "Vue", "Angular"] },
              { type: "numeric", text: "Years of experience?", min: 0, max: 10 },
              { type: "file", text: "Upload your project zip file" },
              { type: "short", text: "Define props in React." },
              { type: "long", text: "Describe how reconciliation works." },
              { type: "single", text: "React is ___?", options: ["Library", "Framework", "Language"] },
              { type: "multi", text: "Choose valid React hooks:", options: ["useState", "useEffect", "useMemo"] },
            ],
          },
        ],
      },
      {
        title: "Backend Developer Assessment",
        sections: [
          {
            name: "Node & API Design",
            questions: [
              { type: "short", text: "What is an API?" },
              { type: "long", text: "Explain REST architecture." },
              { type: "single", text: "Which protocol is stateless?", options: ["HTTP", "FTP", "SMTP"] },
              { type: "multi", text: "Select database technologies:", options: ["MongoDB", "MySQL", "React"] },
              { type: "numeric", text: "Rate Node.js skill (1-10)", min: 1, max: 10 },
              { type: "file", text: "Upload backend code" },
              { type: "short", text: "What is middleware?" },
              { type: "long", text: "Explain the event loop." },
              { type: "single", text: "Which manages dependencies?", options: ["npm", "nvm", "node"] },
              { type: "multi", text: "Select async patterns:", options: ["Promises", "Callbacks", "Async/Await"] },
            ],
          },
        ],
      },
      {
        title: "UI/UX Designer Assessment",
        sections: [
          {
            name: "Design Principles",
            questions: [
              { type: "short", text: "What is UI design?" },
              { type: "long", text: "Explain color psychology." },
              { type: "single", text: "Which is a vector tool?", options: ["Figma", "Photoshop", "MS Paint"] },
              { type: "multi", text: "Select UX methods:", options: ["Wireframing", "Usability Testing", "Prototyping"] },
              { type: "numeric", text: "Years in UI design?", min: 0, max: 15 },
              { type: "file", text: "Upload your portfolio" },
              { type: "short", text: "Define typography." },
              { type: "long", text: "Describe responsive design." },
              { type: "single", text: "Which unit is scalable?", options: ["em", "px", "mm"] },
              { type: "multi", text: "Select design tools:", options: ["Figma", "Sketch", "Canva", "XD"] },
            ],
          },
        ],
      },
    ];
    await db.assessments.bulkAdd(sampleAssessments);
    console.log("âœ… Seeded 3 assessments successfully!");
  }
};

export default function Builder() {
  const [assessments, setAssessments] = useState([]);

  // Load data from IndexedDB
  const loadAssessments = async () => {
    const data = await db.assessments.toArray();
    setAssessments(data || []);
  };

  useEffect(() => {
    seedData().then(loadAssessments);
  }, []);

  // ðŸ§© Safe rendering â€” avoids undefined .map()
  return (
    <div style={{ display: "flex", flexWrap: "wrap", gap: "20px" }}>
      {assessments.length === 0 ? (
        <p>Loading assessments...</p>
      ) : (
        assessments.map((a) => (
          <div
            key={a.id}
            style={{
              flex: "1 1 30%",
              minWidth: "280px",
              background: "#fff",
              borderRadius: "12px",
              padding: "15px",
              boxShadow: "0 2px 6px rgba(0,0,0,0.15)",
            }}
          >
            <h2 style={{ color: "#007bff" }}>{a.title}</h2>
            {(a.sections || []).map((s, i) => (
              <div key={i}>
                <h4 style={{ borderBottom: "1px solid #ddd" }}>{s.name}</h4>
                <ul style={{ paddingLeft: "15px" }}>
                  {(s.questions || []).map((q, idx) => (
                    <li key={idx}>
                      {q.text}{" "}
                      <small style={{ color: "#888" }}>
                        ({q.type}{q.options ? ` â€¢ ${q.options.length} options` : ""})
                      </small>
                    </li>
                  ))}
                </ul>
              </div>
            ))}
          </div>
        ))
      )}
    </div>
  );
}
